  /// Deletes List<Tag> bulk by query
  ///
  /// <returns>BoolResult res.success= true (Deleted), false (Could not be deleted)
  @override
  Future<BoolResult> delete([bool hardDelete = false]) async {
    buildParameters();
    var r = BoolResult(success: false);
    // Check sub records where in (Note) according to DeleteRule.NO_ACTION

    final idListNoteBYtag = toListPrimaryKeySQL(false);
    final resNoteBYtag = await Note()
        .select()
        .where('tag IN (${idListNoteBYtag['sql']})',
            parameterValue: idListNoteBYtag['args'])
        .toCount();
    if (resNoteBYtag > 0) {
      return BoolResult(
          success: false,
          errorMessage:
              'SQFENTITY ERROR: The DELETE statement conflicted with the REFERENCE RELATIONSHIP (Note.tag)');
    }

    if (_softDeleteActivated && !hardDelete) {
      r = await _mnTag!.updateBatch(qparams, {'isDeleted': 1});
    } else {
      r = await _mnTag!.delete(qparams);
    }
    return r;
  }

